var nsmobile = angular.module("nsmobile", []);

nsmobile.controller("wrapperController", function ($scope, transactions){
    $scope.menu = function(id, $event) {
        if($event)
        {
            $($event.currentTarget).parent().parent().children().removeClass('active');
            $($event.currentTarget).parent().addClass('active');
        }
        if(id == 1)
        {
            $scope.pageTitle = 'Dashboard';

        }
        else if(id == 2)
        {
            $scope.pageTitle = 'Sales orders';
            transactions.getSalesOrders().then(function(data) {
                $scope.contentBody = data;
            });
        }
        else if(id == 3)
        {
            $scope.pageTitle = 'Invoices';
            transactions.getInvoices().then(function(data) {
                $scope.contentBody = data;
            });
        }
        else if(id == 4)
        {
            $scope.pageTitle = 'Return authorizations';
            transactions.getReturnAuthorizations().then(function(data) {
                $scope.contentBody = data;
            });
        }
        else if(id == 5)
        {
            $scope.pageTitle = 'Contacts';
        }
        else if(id == 6)
        {
            $scope.pageTitle = 'Need help';
        }
    };

    $scope.asideMenu = function(id, $event){
        if(id == 1)
        {
            $scope.pageTitle = 'Change email';

        }
        else if(id == 2)
        {
            $scope.pageTitle = 'Change password';

        }
    };

    $scope.menu(1);

});
var url = "/app/site/hosting/restlet.nl?script=944&deploy=1";
nsmobile.service('transactions', function($http) {
    return {
        getSalesOrders: function() {
            return $http.get(url + "&type=salesorder",
            {
                data: "", headers: { "Content-Type": "application/json"}
            });
        }

        , getInvoices: function() {
            return $http.get(url + "&type=invoice",
            {
                data: "", headers: { "Content-Type": "application/json"}
            });
        }

        , getReturnAuthorizations: function() {
            return $http.get(url + "&type=returnauthorization",
                {
                    data: "", headers: { "Content-Type": "application/json"}
                });
        }
    };
});


